getPredefinedProof a hypotheses = (a : [])

myImplication a b = ((not a) || b)

evaluate expression@(Variable a) hypotheses = List.elem expression hypotheses
evaluate (Implication a b)       hypotheses = myImplication (evaluate a hypotheses) (evaluate b hypotheses)
evaluate (Disj a b)              hypotheses = (evaluate a hypotheses) || (evaluate b hypotheses)
evaluate (Conj a b)              hypotheses = (evaluate a hypotheses) && (evaluate b hypotheses)
evaluate (NegationNot a)         hypotheses = (not (evaluate a hypotheses))

checkMember a@(NegationNot a1) l1 l2 = (List.elem a l1) && (List.elem a1 l2)
checkMember a                  l1 l2 = (List.elem a l1) && (List.elem (NegationNot a) l2)

data Hypotheses = SingleHypotheses [Expression]
             | TripleHypotheses [Expression] Hypotheses Hypotheses deriving Show

getHypotheses (SingleHypotheses a)     = a
getHypotheses (TripleHypotheses a b c) = a

getFirstHypotheses (TripleHypotheses a b c) = b

getSecondHypotheses (TripleHypotheses a b c) = c

converted []       hypotheses result = result
converted (x : xs) hypotheses result =
    if ((length hypotheses2) == 1) then
        let
            hypotheses3 = hypotheses2 !! 0
        in
            if ((checkMember hypotheses3 xExpr hypothesesExpr) || (checkMember hypotheses3 hypothesesExpr xExpr)) then
                converted xs hypotheses ((TripleHypotheses hypotheses1 hypotheses x) : result)
            else
                converted xs hypotheses result
    else
        converted xs hypotheses result
    where
        hypothesesExpr = getHypotheses hypotheses
        xExpr          = getHypotheses x
        hypotheses1    = List.intersect xExpr hypothesesExpr
        hypotheses2    = (List.\\) xExpr hypotheses1

minimizeHypotheses []       result = result
minimizeHypotheses (x : xs) result = minimizeHypotheses xs ((converted xs x []) ++ result)

